import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../css/Navbar.css";

function Navbar() {
  const [isActive, setActive] = useState("/");
  const [isMobileOpen, setMobileOpen] = useState(false);

  let url = window.location.href;
  let i = url.lastIndexOf("/") + 1;
  let path = url.slice(i);
  if (!path) {
    path = "/";
  }
  if (isActive !== path) {
    setActive(path);
  }

  return (
    <nav>
      <div className="mobile-only">
        <MobileNavbarToggler
          setMobileOpen={setMobileOpen}
          isMobileOpen={isMobileOpen}
        />
        <MobileDropdown
          isMobileOpen={isMobileOpen}
          setMobileOpen={setMobileOpen}
          isActive={isActive}
        />
      </div>
      <div className="non-mobile">
        <DesktopNavbar isActive={isActive} setActive={setActive} />
      </div>
    </nav>
    /* <div
        className="nav-bar-bg nav-bar-border collapse slow-down mobile-only"
        style={isMobileOpen ? { height: "100%" } : { height: "0" }}
      >
        <div className="p-4" id="mobile-navbar-buttons">
          <Link
            to="/"
            className="btn btn-link btn-block m-0 bkgr-2-no-border side-a"
            id="index"
          >
            Home
          </Link>
          <hr></hr>
          <Link
            to="/my-learning"
            className="btn btn-link btn-block m-0 bkgr-2-no-border side-a"
            id="my-learning"
          >
            My Learning
          </Link>
          <hr></hr>
          <Link
            to="/contact-me"
            className="btn btn-link btn-block m-0 bkgr-2-no-border side-a"
            id="contact-me"
          >
            Contact Me
          </Link>
          <hr></hr>
          <div style={{ height: 45 }}></div>
          <Link
            to="/Resume"
            className="btn btn-link btn-block m-0 bkgr-2-no-border side-a resume"
          >
            Resume
          </Link>
        </div>
      </div> */
  );
}

function MobileNavbarToggler(props) {
  return (
    <button
      className="mobile-toggler"
      type="button"
      onClick={() => props.setMobileOpen(!props.isMobileOpen)}
      aria-label="Toggle navigation"
    >
      <div
        className={` ${
          props.isMobileOpen ? "animated-icon open" : "animated-icon"
        } `}
      >
        <span></span>
        <span></span>
        <span></span>
      </div>
    </button>
  );
}

function MobileDropdown(props) {
  return (
    <div
      className={
        props.isMobileOpen ? "mobile-dropdown open" : "mobile-dropdown"
      }
    >
      <MobileNavItem
        id="/"
        isActive={props.isActive}
        setActive={props.setActive}
        buttonString="Home"
      />
      <hr />
      <MobileNavItem
        id="studies"
        isActive={props.isActive}
        setActive={props.setActive}
        buttonString="My Learning"
      />
      <hr />
      <MobileNavItem
        id="contact"
        isActive={props.isActive}
        setActive={props.setActive}
        buttonString="Contact Me"
      />
      <hr />
      <Link
        to="/resume"
        className="resume"
        onClick={() => {
          setTimeout(() => {
            props.setMobileOpen(false);
          }, 250);
          // props.setActive("resume");
        }}
      >
        Resume
      </Link>
    </div>
  );
}

function MobileNavItem(props) {
  return (
    <Link
      to={props.id}
      className={` ${
        props.isActive === props.id ? "mobile-nav active-button" : "mobile-nav"
      } `}
      onClick={() => props.setActive(props.id)}
    >
      {props.buttonString}
    </Link>
  );
}

function DesktopNavbar(props) {
  return (
    <ul>
      <DesktopNavItem
        id="/"
        isActive={props.isActive}
        setActive={props.setActive}
        buttonString="Home"
      />
      <DesktopNavItem
        id="studies"
        isActive={props.isActive}
        setActive={props.setActive}
        buttonString="My Learning"
      />
      <DesktopNavItem
        id="contact"
        isActive={props.isActive}
        setActive={props.setActive}
        buttonString="Contact Me"
      />
      <li>
        <Link
          to="/resume"
          className="resume"
          onClick={() => props.setActive("resume")}
        >
          Resume
        </Link>
      </li>
    </ul>
  );
}

function DesktopNavItem(props) {
  return (
    <li>
      <Link
        to={props.id}
        className={` ${
          props.isActive === props.id
            ? "desktop-nav active-button"
            : "desktop-nav"
        } `}
        onClick={() => props.setActive(props.id)}
      >
        {props.buttonString}
      </Link>
    </li>
  );
}

export default Navbar;
